import React from 'react';
import { Table, Image } from 'semantic-ui-react';

const TableRow = (props) => {
    return (
        <div>
            <Table.Cell>{props.row.rank}</Table.Cell>
            <Table.Cell><Image src={props.row.logo}/> {props.row.teamName}</Table.Cell>
            <Table.Cell>{props.row.all.matchesPlayed}</Table.Cell>
            <Table.Cell>{props.row.all.win}</Table.Cell>
            <Table.Cell>{props.row.all.draw}</Table.Cell>
            <Table.Cell>{props.row.all.lose}</Table.Cell>
            <Table.Cell>{props.row.all.goalsFor}</Table.Cell>
            <Table.Cell>{props.row.all.goalsAgainst}</Table.Cell>
            <Table.Cell>{props.row.goalsDiff}</Table.Cell>
            <Table.Cell>{props.row.points}</Table.Cell>
        </div>
    );
}

export default TableRow;
